FighterReg.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity ^0.8.26;

import "./JudgeReg.sol";


contract FighterReg is JudgeReg {

// Event to be able to easily be seen on system =============
    event NewFighter(uint fighterId, string fighterName);

// Setting modifier owner of for fighters =====================



// Getting the databse of fighters and judges ==================
    struct MMAfighter {
        string name;
        uint32 win;
        uint32 loss;
        uint32 draw;
        uint16 noContest;
        uint8 weightCategoryLbs;
    }

// defining an array for Judges and MMA fighters =================
    MMAfighter[] public fighters;

// index position 1 in the array in case of a draw to avoid confusion 

    constructor() {
    // Push a dummy fighter at index 0
    fighters.push(MMAfighter("", 0, 0, 0, 0, 0));
}


// Mapping of users to ID number =============================
    mapping (uint => address) public fighterToOwner;    
    mapping (uint => MMAfighter) public fighterIdToFighter;
    mapping (address => uint256) fighterbalance;

// Modifier of fighter requiring owner ===============================

    modifier onlyFighter(uint _judgeId) {
        require(msg.sender == fighterToOwner[_judgeId]);
        _;
    }


// Register fighter ===============================================    
    function _registerMMAFighter(string memory _name, uint32 _wins, uint32 _losses, uint32 _draws, uint16 _nc, uint8 _weight) public {
        fighters.push(MMAfighter(_name, _wins, _losses, _draws, _nc, _weight));
        uint256 id = fighters.length - 1;
        fighterToOwner[id] = msg.sender;
        emit NewFighter(id, _name);
    }
}

JudgeReg.sol.content:
//SPDX-License-Identifier: MIT

pragma solidity ^0.8.26;

import "@openzeppelin/contracts/access/Ownable.sol";


contract JudgeReg is Ownable {
// Constructor to link to openzepplin code ==================    
    constructor() Ownable(msg.sender) {}

// Event to be able to oeasili be seen on system =============
    event NewJudge(uint judgeId, string judgeName);

// Getting the databse of fighters and judges ==================
    struct Judge {
        string name;
        uint16 rank;
        uint32 rightDecision;
        uint16 wrongDecision;
    }

// defining an array for MMA fighters =================
    Judge[] public judges;

// Mapping of users to ID number =============================
    mapping (uint => address) public judgeToOwner;
    mapping (address => uint) public ownerToJudge;
    mapping (address => uint256) judgeBalance;

// Setting modifier for the owner of for the judges ====================

    modifier onlyJudge(uint _judgeId) {
        require(msg.sender == judgeToOwner[_judgeId]);
        _;
    }

// Register judge ====================================================
    function _registerJudge(string memory _name) public  { 
        require(ownerToJudge[msg.sender] == 0, "Judge already exsists"); // prevents multiple judges per address 
        judges.push(Judge(_name, 1, 0, 0));
        uint256 id = judges.length - 1;
        judgeToOwner[id] = msg.sender;
        ownerToJudge[msg.sender] = id;
        emit NewJudge(id, _name);
    }
}

